	add("argentocracy", "{\"term\":\"argentocracy\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"\u0027argent\u0027 (silver) (from Latin \u0027argentum\u0027 + \u0027-o-\u0027 (from Ancient greek (to 1453) \u0027-ο-\u0027 {{suffix||cracy||power”, “rule (of)|lang\u003den}} (from Ancient greek (to 1453) \u0027κράτος\u0027 (power”, “might)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"plutocracy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1868\u0027\u0027 May 23, \u0027w:Pall Mall Pall Mall Gazette\u0027, page 11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the disease of \u0027\u0027argentocracy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, John Stephens and Robyn McCallum, \u0027Retelling Stories, Framing Culture: Traditional Story and Metanarratives in Children’s Literature\u0027 ISBN 9780815312987, [http://books.google.co.uk/books?id\u003dIjJ8BXHYZFgC\u0026amp;pg\u003dRA1-PA182\u0026amp;dq\u003d%22argentocracy%22\u0026amp;ei\u003dy5ulSriwCpu-ygTAhfmdC\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22argentocracy%22\u0026amp;f\u003dfalse page 182\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Argent the capitalist, Leeson implies, much more overtly than was possible for Stevenson, who lacked the benefit of hindsight which informs Leeson’s late–twentieth-century text, that capitalism is a form of piracy. Even Silver’s parrot, Flint, has undergone a transformation in \u0027Silver’s Revenge\u0027, now saying “ten percent, take it or leave it!” (p. 111) instead of “pieces of eight.” The term “argent” also has associations with money lending (an argenter) — as it emerges when the \u0027Hispaniola\u0027 is about to set sail for Treasure Island for the second time that it is Argent/Silver who owns and has put up the boat. As with other characters in the novel, Silver/Argent is also typecast through his speech. He speaks the discourse of capitalism or \u0027\u0027argentocracy\u0027\u0027 (the rule or paramount influence of money), as in, “My proposition, friends, is that money overrides both law and custom and even natural justice and is a law and reason unto itself” (p. 48). Silver/Argent’s skill, however, lies in his ability to code-switch between a range of discursive genres: the discourses of piracy, respectability, and capitalism. Thematically, this code-switching foregrounds the similarity between piracy and industrialism, grounded in the common denominator of “treasure seeking.”\", \"priority\":6}]}, \"synonyms\":{}}");

	add("argilliturbation", "{\"term\":\"argilliturbation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mixing process in clay rich soils subjected to cycles of wet and dry, whereby the soil expands when wet and contracts as it dries, causing soil, stones and artefacts to move up and down\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Jon Erlandson, \u0027Early Hunter-Gatherers of the California Coast\u0027, %22argilliturbations%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9txpT9C3HoOgiQeH-MnMCg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22argilliturbations%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 165\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"At SBA-1807 and SBA-2061, these processes include bioturbation, \u0027\u0027argilliturbation\u0027\u0027, chemical weathering, downslope movement, natural addition of faunal remains to the midden, wildfires, trampling, grading, plowing, and discing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Randall J. Schaetzl, Sharon Anderson, \u0027Soils: Genesis and Geomorphology\u0027, %22argilliturbations%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9txpT9C3HoOgiQeH-MnMCg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22argilliturbations%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 291\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In extreme situations, \u0027\u0027argilliturbation\u0027\u0027 can result in a surface stone pavement (Johnson and Hester 1972, Muhs 1982\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Robert L. Kelly, David Hurst Thomas, \u0027Archaeology\u0027, %22argilliturbations%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9txpT9C3HoOgiQeH-MnMCg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22argilliturbations%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 112\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A site′s stratigraphy can become thoroughly churned if this \u0027\u0027argilliturbation\u0027\u0027 process takes place over and over for hundreds or thousands of years\", \"priority\":10}]}, \"synonyms\":{}}");

