	add("argument", "{\"term\":\"argument\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) from Anglo-norman from Old french (842-ca. 1400) from Latin \u0027argumentum\u0027 (proof, evidence, token, subject, contents) from \u0027arguere\u0027 () see argue.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fact or statement used to support a proposition; \u0026lt;span id\u003d\u0026quot;N1\u0026quot;\u0026gt;a reason\u0026lt;/span\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There is no more palpable and convincing \u0027\u0027argument\u0027\u0027 of the existence of a Deity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;span id\u003d\u0026quot;N2\u0026quot;\u0026gt;A verbal dispute; a quarrel.\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"lt;span id\u003d\u0026quot;N3\u0026quot;\u0026gt;A process of reasoning.\u0026lt;/span\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"John Lock\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027argument\u0027\u0027 is not about things, but names\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"lt;span id\u003d\u0026quot;N4\u0026quot;\u0026gt;\u0026lt;/span\u0026gt; A series of propositions organized so that the final proposition is a conclusion which is intended to follow logically from the preceding propositions, which function as premises\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"lt;span id\u003d\u0026quot;N5\u0026quot;\u0026gt; The independent variable of a function.\u0026lt;/span\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"lt;span id\u003d\u0026quot;N6\u0026quot;\u0026gt; A value\u0026lt;/span\u0026gt;, or reference to a value, passed to a function. \u0026lt;!-- call by value v.s. call by reference --\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In ‘The Critic of Arguments’ (1892), Peirce adopts a notion that is even closer to that of a propositional function. There he develops the concept of the ‘rhema’. He says the rhema is like a relative term, but it is not a term. It contains a copula, that is, when joined to the correct number of arguments it produces an assertion. For example, ‘__ is bought by __ from __ for __’ is a four-place rhema. Applying it to four objects \u0027a\u0027, \u0027b\u0027, \u0027c\u0027, and \u0027d\u0027 produces the assertion that \u0027a\u0027 is bought by \u0027b\u0027 from \u0027c\u0027 for \u0027d\u0027 (ibid. 420\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Parameters are like labeled fillable blanks used to define a function whereas \u0027\u0027arguments\u0027\u0027 are passed to a function when calling it, filling in those blanks\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"lt;span id\u003d\u0026quot;N7\u0026quot;\u0026gt; A parameter\u0026lt;/span\u0026gt; in a function definition; an actual parameter, as opposed to a formal parameter\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Any of the phrases that bears a syntactic connection to the verb of a clause\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"In numerous works over the past two decades, beginning with the pioneering work of Gruber (1965), Fillmore (1968a), and Jackendoff (1972), it has been argued that each \u0027\u0027Argument\u0027\u0027 (i.e. Subject or Complement) of a Predicate bears a particular \u0027thematic role\u0027 (alias \u0027theta-role\u0027, or \u0027\u0026amp;theta;-role\u0027 to its Predicate), and that the set of \u0027thematic functions\u0027 which \u0027\u0027Arguments\u0027\u0027 can fulfil are drawn from a highly restricted, finite, universal set\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The quantity on which another quantity in a table depends\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The altitude is the \u0027\u0027argument\u0027\u0027 of the refraction\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The subject matter of a discourse, writing, or artistic representation; theme or topic; also, an abstract or summary, as of the contents of a book, chapter, poem\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"You and love are still my \u0027\u0027argument\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Jeffre\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"the abstract or \u0027\u0027argument\u0027\u0027 of the piec\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"shields] with boastful \u0027\u0027argument\u0027\u0027 portraye\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Matter for question; business in hand\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Sheathed their swords for lack of \u0027\u0027argument\", \"priority\":26}]}, \"synonyms\":{}}");

